Weitere Absicherung der GmbH
Zum Umfang der denkbaren weiteren Absicherung der GmbH in banküblichem Umfang kann nicht
abschließend Stellung genommen werden. Denkbar sind hier insbesondere:
- Abtretung der Rechte und Ansprüche aus dem Ingenieurvertrag mit der INeG;
- Abtretung der Gewährleistungsansprüche gegen die Hauptlieferanten, sowie der Sicher-
heitseinbehalte und/oder Erfüllungsbürgschaften;
- Abtretung der Rechte und Ansprüche aus bestehenden und neu abzuschließenden Versi-
cherungsverträgen;
- Abtretung der Rechte und Ansprüche aus sämtlichen Verträgen zum Betrieb des Wärmenet-
zes;
- Abtretung sämtlicher Rechte und Ansprüche aus den Wärmelieferverträgen mit Kunden/End-
abnehmern;
- Abtretung der Rechte und Ansprüche auf Erstattung der Umsatzsteuer im Zusammenhang
mit dem Bau des Wärmenetzes;
